/*
 * @Author: renlei
 * @Date: 2020-05-18 16:26:56
 * @LastEditors: renlei
 * @LastEditTime: 2020-05-18 17:19:07
 * @Description:
 */
import Head from "next/head";
const Page = ({ stars }) => (
  <div>
    <Head>
      <title>My page title</title>
      <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      <meta name="" content="initial-scale=1.0, width=device-width" />
      <meta name="keywords" content="HTML,ASP,PHP,SQL"></meta>
      <meta name="description" content="免费在线教程"></meta>
    </Head>
    Hello world
    <p>{stars}</p>
    <style jsx>{`
      p {
        color: blue;
      }
      div {
        background: red;
      }
      @media (max-width: 600px) {
        div {
          background: blue;
        }
      }
    `}</style>
    <style global jsx>{`
      body {
        background: black;
      }
    `}</style>
  </div>
);
Page.getInitialProps = async ({ req }) => {
  const res = await fetch(
    "http://rap2.taobao.org:38080/app/mock/222615/%20popularAuthor"
  );
  //  console.log(JSON.stringify(res));
  const json = await res.json();

  return { stars: json.stargazers_count };
};

export default Page;
